import React, { Component } from "react";
import { render } from "react-dom";
import StorePicker from "./components/StorePicker.jsx";
import App from "./components/App.jsx";
import "./css/style.css";

render(
  <StorePicker>
    <App />
  </StorePicker>,
  document.querySelector("#main")
);
